import React from 'react';

export function ColorizedSpan(props) {
    console.log(`ColorizedSpan: ${props.text}`)
    return <h1>{props.text}</h1>;
}

export default function CustomSpan(props) {
    return <ColorizedSpan  text={props.text}/>;
}
